def _partially_consume_prefix(self, prefix, column):
    lines = []
    current_line = ""
    current_column = 0
    wait_for_nl = False
    in_comment = False
    for char in prefix:
        if in_comment and char != '\n':
            current_line += char
            continue
        if wait_for_nl:
            if char == '\n':
                if current_line.strip() and current_column < column:
                    res = ''.join(lines)
                    return res, prefix[len(res):]

                lines.append(current_line)
                current_line = ""
                current_column = 0
                wait_for_nl = False
        elif char == ' ' and not in_comment:
            current_column += 1
        elif char == '\t' and not in_comment:
            current_column += 4
        elif char == '\n':
            current_column = 0
            if in_comment and current_line.strip() == '#':
                in_comment = False
        elif char == '#':
            in_comment = True
        else:
            # indent is finished
            wait_for_nl = True
        current_line += char
    return ''.join(lines), current_line
